const poblarDepartamentos = async () => {
  try {
    const data = JSON.parse(dataString);
    for (const deptKey of Object.getOwnPropertyNames(data.departamentos)) {
      const departamento = data.departamentos[deptKey];
      const unidadAdmin = new UnidadAdmin({id: departamento.id, nombre: departamento.nombre, dane: departamento.dane});
      await API.post("umapi", "/unidadesadmin", {
        body: unidadAdmin
      });
      console.log(`Departamento ${departamento.nombre} creado correctamente`);
    }
    for (const ciudadKey of Object.getOwnPropertyNames(data.municipios)) {
      const ciudad = data.municipios[ciudadKey];
      const ciudadObj = new Ciudad({
        id: ciudad.id,
        nombre: ciudad.nombre,
        unidadadminstr: ciudad.unidadadminstr,
        significativo: false,
        unidadadmin: ciudad.unidadadmin,
        dane: ciudad.dane
      });
      await API.post("umapi", "/ciudades", {
        body: ciudadObj
      });
      console.log(`Ciudad ${ciudad.nombre} creada correctamente`);
    }
  } catch (e) {
    console.log(e);
  }
}

const poblarMunicipios = async () => {
  const data = JSON.parse(dataString);
  let query = "";
  for (const capitalKey of Object.getOwnPropertyNames(data.capitales)) {
    query += `UPDATE unidadadmin SET capital = '${data.capitales[capitalKey]}' WHERE id = '${capitalKey}';\n`;
  }
  console.log(query);
  await navigator.clipboard.writeText(query);
}

const corregirImagenes = async () => {
  try {
    const locaciones = await API.get("umapi", "/locaciones", {});
    for (const locacion of locaciones) {
      const carpetaCorregida: any[] = [];
      const imagenData = locacion.carpetaimagenes["LQ"];
      let link = imagenData.substring(0, imagenData.lastIndexOf('/'));
      link = link.substring(0, link.lastIndexOf('/'));
      for (let i = 0; i < 10; i++) {
